import React from "react";
import "./Menuitems.css";

const menus = [
    { 
        title: "키워드 분석 / 카테고리 현황", 
        path: "/analyze", 
        cName: "nav-links"
    },
    { 
        title: "제품 트래킹 (Naver & Coupang)", 
        path: "/product-track",
        cName: "nav-links"
    },
    {
        title: "대량 키워드 검색", 
        path: "/mass-search",
        cName: "nav-links"
    },
    {
        title: "블로그 노출 확인", 
        path: "/blog-check",
        cName: "nav-links"
    }
];


function Menuitems({menu}){
    return (
        <div className = "menu-item">
            <p>{menu.name}</p>
        </div>
    );
}

export default Menuitems;
